import React from 'react'
import Image1 from '../images/pogled I2.webp'
import Image2 from '../images/pogled S-Z2.webp'
import Image3 from '../images/pticja J.webp'


export default function Properties() {
  return (
    <div>
      <p><img src={Image1} className="slide-image" alt="house images" /></p>
      <p><img src={Image2} className="slide-image" alt="house images" /></p>
      <p><img src={Image3} className="slide-image" alt="house images" /></p>
    </div>
  )
}
